import {Typography} from "@material-ui/core"
import {TextField} from "@material-ui/core"
import {className} from "@material-ui/core"
import { useState } from "react"

function App() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [subject, setSubject] = useState('');
  const [message, setMessage] = useState('');
  return <div style={{ textAlign: "center", marginTop: 40}}>
    <Typography variant="h2">Email Rocket ðŸš€</Typography>

    <form style= {{marginTop: 30}}>
      <TextField 
        id="standard-basic" 
        label="Email" 
        value = {email}
        onChange = {(e) => setEmail(e.target.value)}/>
      <br/>  

      <TextField 
        style={{ marginTop: 20 }}id="standard-password-input"
          label="Password"
          value = {password}
          onChange = {(e) => setPassword(e.target.value)}
          type="password"
          autoComplete="current-password" />

        <br/>
        <TextField 
          style={{ marginTop: 20 }}
          id="standard-textarea"
          label="Subject"
          value = {subject}
          onChange = {(e) => setSubject(e.target.value)}
          placeholder="Placeholder"
          multiline
        />
        <br/>
        <TextField 
          style={{ marginTop: 10 }}
          id="standard-textarea"
          label="Message"
          value = {message}
          onChange = {(e) => setMessage(e.target.value)}
          placeholder="Placeholder"
          multiline
         endAdornment={<InputAdornment position="end">Character Count: 0</InputAdornment>}
        />
        <br/>


    </form>
    </div>;
}

export default App;
